#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

const int MAXN = 55;

int n, m;
vector<int> g[MAXN];
int low[MAXN], disc[MAXN], parent[MAXN], time = 0;
bool visited[MAXN];
int ans = 0;

void dfs(int u) {
    disc[u] = low[u] = time++;
    visited[u] = true;
    int child = 0;
    for (int v : g[u]) {
        if (!disc[v]) {
            parent[v] = u;
            child++;
            dfs(v);
            low[u] = min(low[u], low[v]);
            if (low[v] > disc[u]) {
                ans++;
            }
        } else if (v != parent[u]) {
            low[u] = min(low[u], disc[v]);
        }
    }
}

int main() {
    cin >> n >> m;
    for (int i = 0; i < m; i++) {
        int u, v;
        cin >> u >> v;
        g[u].push_back(v);
        g[v].push_back(u);
    }
    dfs(1);
    cout << ans << endl;
    return 0;
}
